<!DOCTYPE html>
<head>
  <meta charset="utf-8">
</head>
<body>
  <div id="log" style="padding-left:20px;padding-top:20px;font-size:200%;"></div>
  <script>
    function log() {
      var args, result;
      var  __slice = [].slice;
      args = 1 <= arguments.length ? __slice.call(arguments, 0) : [];
      result = '';
      args.forEach(function(arg) {
        return result += arg.toString();
      });
      result = result + '<br />'
      var existingInnerHTML  = document.getElementById('log').innerHTML;
      return document.getElementById('log').innerHTML = existingInnerHTML + result;
    };
  </script>
  <script src="../lab.js"></script>
  <script>document.write('<script src="http://' + (location.host || 'localhost').split(':')[0] + ':35729/livereload.js?snipver=1"></' + 'script>')</script>
</body>
</html>
